import React,{useContext} from 'react'
import { contextData } from './Context'

export const TopFeaterudArts = () => {
    const [data] = useContext(contextData) 
    // console.log(data[0].title,data[1].id);
    // const oneData =data.filter((x)=>x.id<4);
    const data1=[],data2=[];
    data.forEach(k=> {
    switch (k.id) {
        case "1":
            data1.push(data[k.id]);
            console.log(data1);
            break;
        case "2":
            data2.push(data[k.id]);
            console.log(data2);
            break;
        case "3":
            data2.push(data[k.id]);
            console.log(data2);
            break;
        default:
            break;

    }  
    });


    return (
        <div className='TopBanner'>
            {
                data1.map((a)=>
                    <div  style={{
                        backgroundImage:`url(${a.image})`
                        }}>
                        {a.title}
                        {a.category}/{a.date}
                    </div>
                )
                }{
                data2.map((a)=>
                    <div  style={{
                        backgroundImage:`url(${a.image})`
                        }}>
                        {a.title}
                        {a.category}/{a.date}
                    </div>
                )
            }
        </div>
    )
}
